import React from "react";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { feedPosts, GetUserPostData } from "../../api/PostRequest";
import { setPosts } from "../../state";
import PostWidget from "./PostWidget";

const PostsWidget = ({ userId, isProfile = false }) => {
  const dispatch = useDispatch();
  const posts = useSelector((state) => state.posts);
  const token = useSelector((state) => state.token);

  const getPosts = async () => {
    const response = await feedPosts({ headers: { Authorization: `Bearer ${token}` }})
   
    if(response.data){
      console.log('its workingggggggggggggg');
      const data = response.data
      dispatch(setPosts({ posts: data }));
    }
   
  };

  const getUserPosts = async () => {
    const response = await GetUserPostData(userId, {
      headers: { Authorization: `Bearer ${token}` },
    });
    console.log(response.data,'enthdaaaa');

    if (response.data) {
      const data = response.data
      dispatch(setPosts({ posts: data }));
    }
  };

  useEffect(() => {
    if (isProfile) {
      getUserPosts();
    } else {
      getPosts();
    }
  }, []); // eslint-disable-line react-hooks/exhaustive-deps

  return (
    <>
      {Array.isArray(posts)
        ? posts.map(
            ({
              _id,
              userId,
              firstName,
              lastName,
              description,
              location,
              picturePath,
              userPicturePath,
              likes,
              comments,
            }) => (
              <PostWidget
                key={_id}
                postId={_id}
                postUserId={userId}
                name={`${firstName} ${lastName}`}
                description={description}
                location={location}
                picturePath={picturePath}
                userPicturePath={userPicturePath}
                likes={likes}
                comments={comments}
              />
            )
          )
        : null}
    </>
  );
};

export default PostsWidget;
